var calculateAreas = function(classifiedImage,bandname,aoi,year,title,colors,names){
  var areaImage = ee.Image.pixelArea().divide(1e4).addBands(classifiedImage);
  print(areaImage);
  var areasChart = ui.Chart.image.byClass({
      image: areaImage,
      classBand: bandname,
      scale: 30,
      region: aoi,
      reducer: ee.Reducer.sum(),
      classLabels: names
    });
  if(year == '2020'){
      areasChart.setOptions({
        hAxis: {title: 'Classes'},
        vAxis: {title: 'Area (Hectares)'},
        title: title,
        colors: colors
      })
      chartPanel.clear();
      chartPanel.add(areasChart);
      // print('------- Chart Generated ---------',areasChart.getDataTable())
    } else if(year == '2016'){
        areasChart.setOptions({
          hAxis: {title: 'Classes'},
          vAxis: {title: 'Area (Hectares)'},
          title: title,
          colors: colors
        })
        chartPanel1.clear();
        chartPanel1.add(areasChart);
        // print('------- Chart Generated ---------',areasChart1.getDataTable())
    }
}
